import { motion } from 'framer-motion';
import { Dumbbell } from 'lucide-react';

const Header = () => {
  return (
    <motion.header 
      initial={{ y: -100 }}
      animate={{ y: 0 }}
      className="bg-indigo-600 text-white shadow-lg"
    >
      <div className="container mx-auto px-4 py-6">
        <div className="flex items-center justify-between">
          <motion.div 
            className="flex items-center"
            whileHover={{ scale: 1.05 }}
          >
            <Dumbbell size={32} className="mr-3" />
            <h1 className="text-2xl font-bold">FitSplit</h1>
          </motion.div>

          <nav>
            <ul className="flex space-x-6">
              <li><a href="#" className="hover:text-indigo-200 transition-colors">Dashboard</a></li>
              <li><a href="#" className="hover:text-indigo-200 transition-colors">Progress</a></li>
              <li><a href="#" className="hover:text-indigo-200 transition-colors">Profile</a></li>
            </ul>
          </nav>
        </div>

        <p className="mt-2 text-indigo-200 max-w-xl">
          Get personalized workout splits based on your gym consistency score
        </p>
      </div>
    </motion.header>
  );
};

export default Header;
